// ##################################################################
// ### SCL-90-R Logic and Data                                    ###
// ##################################################################

const scales = {
    'Somatisierung': [1, 4, 12, 27, 40, 42, 48, 49, 52, 53, 56, 58],
    'Zwanghaftigkeit': [3, 9, 10, 28, 38, 45, 46, 51, 55, 65],
    'Unsicherheit im Sozialkontakt': [6, 21, 34, 36, 37, 41, 61, 69, 73],
    'Depressivität': [5, 14, 15, 20, 22, 26, 29, 30, 31, 32, 54, 71, 79],
    'Ängstlichkeit': [2, 17, 23, 33, 39, 57, 72, 78, 80, 86],
    'Aggressivität/Feindseligkeit': [11, 24, 63, 67, 74, 81],
    'Phobische Angst': [13, 25, 47, 50, 70, 75, 82],
    'Paranoides Denken': [8, 18, 43, 68, 76, 83],
    'Psychotizismus': [7, 16, 35, 62, 77, 84, 85, 87, 88, 90],
};

const scaleDetails = {
    'Somatisierung': { items: 12, inhalt: "Erfasst körperliche Beschwerden, die nicht hinreichend somatisch erklärt werden können.", symptome: "Kreislaufprobleme, Magen-Darm-Beschwerden, Atemnot, Muskelschmerzen.", bedeutung: "Häufig bei somatoformen Störungen, aber auch bei Depressionen, Angststörungen und posttraumatischen Belastungsstörungen." },
    'Zwanghaftigkeit': { items: 10, inhalt: "Deckt ein Kontinuum von Konzentrations- und Entscheidungsproblemen bis hin zu schwerwiegenden Zwangsgedanken und -handlungen ab.", symptome: "Perfektionismus, wiederholtes Kontrollieren, Grübeln, ritualisiertes Verhalten.", bedeutung: "Hinweis auf Zwangsstörungen, aber auch auf eine überkontrollierte Persönlichkeit oder neurotische Anspannung." },
    'Unsicherheit im Sozialkontakt': { items: 9, inhalt: "Erfasst subjektive Unsicherheiten im zwischenmenschlichen Bereich, soziale Ängste und Selbstabwertungen.", symptome: "Schüchternheit, Angst vor Ablehnung, Minderwertigkeitsgefühle.", bedeutung: "Typisch bei sozialer Phobie, ängstlich-vermeidender Persönlichkeitsstörung und depressiven Episoden." },
    'Depressivität': { items: 13, inhalt: "Reicht von gedrückter Stimmung, Interessenverlust bis hin zu suizidalen Gedanken.", symptome: "Traurigkeit, Hoffnungslosigkeit, Antriebsverlust, Schuldgefühle, Suizidgedanken.", bedeutung: "Zentrale Skala bei depressiven Störungen." },
    'Ängstlichkeit': { items: 10, inhalt: "Umfasst emotionale, kognitive und körperliche Aspekte der Angst.", symptome: "Nervosität, Herzrasen, Schweißausbrüche, Erwartungsangst.", bedeutung: "Wichtig bei generalisierter Angststörung, Panikstörung und anderen Angsterkrankungen." },
    'Aggressivität/Feindseligkeit': { items: 6, inhalt: "Misst Gereiztheit, Wutimpulse und destruktive Einstellungen gegenüber anderen.", symptome: "Gereiztheit, Wutanfälle, Groll, zynische Gedanken.", bedeutung: "Kann bei Impulskontrollstörungen, Persönlichkeitsstörungen und in Belastungssituationen auffällig sein." },
    'Phobische Angst': { items: 7, inhalt: "Umfasst irrationale, stark eingeengte Ängste mit Vermeidungstendenz.", symptome: "Angst in Menschenmengen, Höhenangst, Platzangst, Angst vor öffentlichen Verkehrsmitteln.", bedeutung: "Hinweis auf spezifische oder soziale Phobien sowie Agoraphobie." },
    'Paranoides Denken': { items: 6, inhalt: "Misstrauen, Gedankenbeeinflussung, überwertige Ideen, Gefühl des Beobachtetwerdens.", symptome: "Misstrauen, Überzeugung, dass andere über einen reden oder Pläne schmieden, übermäßiges Gerechtigkeitsempfinden.", bedeutung: "Kann bei paranoiden Persönlichkeitsstörungen oder psychotischen Zuständen auftreten." },
    'Psychotizismus': { items: 10, inhalt: "Breites Spektrum zwischen sozialem Rückzug, exzentrischem Verhalten bis hin zu psychotischem Erleben.", symptome: "Soziale Isolation, Gefühl der Entfremdung, ungewöhnliche Wahrnehmungen oder Gedanken.", bedeutung: "Achtung bei Verdacht auf Psychosen oder schizotype Störungen." },
    'GSI': { inhalt: "Misst die durchschnittliche psychische Belastung über alle Items hinweg. Er ist der wichtigste globale Indikator für psychische Belastung." },
    'PST': { inhalt: "Zeigt an, wie viele Symptome überhaupt angegeben wurden. Maß für die Symptomvielfalt." },
    'PSDI': { inhalt: "Misst die mittlere Intensität der angegebenen Symptome. Hilfreich zur Einschätzung der Leidensintensität." }
};

const getAgeCategory = (age) => {
    if (age >= 12 && age <= 14) return 1;
    if (age >= 15 && age <= 17) return 2;
    if (age >= 18 && age <= 29) return 3;
    if (age >= 30 && age <= 39) return 4;
    if (age >= 40 && age <= 49) return 5;
    if (age >= 50 && age <= 59) return 6;
