                'PST': 55,
            };

            setResults({ rawScores, tScores, globalScores: { gsi, psdi, pst }, date: newTestDate });
            setViewingResult(null);

        } catch (e) {
            setError(e.message);
        }
    };

    const handleSave = () => {
        if(results) {
            onSaveResult(results);
            alert("Ergebnis gespeichert!");
            resetForm();
        } else {
            setError("Bitte berechnen Sie zuerst die Auswertung.");
        }
    };

    const toggleExpand = (scaleName) => {
        setExpandedScales(prev => ({...prev, [scaleName]: !prev[scaleName]}));
    };

    const getBarColor = (tValue) => {
        if (!tValue) return 'transparent';
        if (tValue >= 60) {
            const intensity = Math.min((tValue - 60) / 30, 1);
            const green = Math.round(107 - intensity * 60);
            const blue = Math.round(107 - intensity * 60);
            return `rgb(239, ${green}, ${blue})`;
        }
        if (tValue >= 55) {
            const intensity = (tValue - 55) / 4;
            const green = Math.round(191 - intensity * 46);
            return `rgb(251, ${green}, 36)`;
        }
        const intensity = Math.max(0, (tValue - 20) / 35);
        const colorValue = Math.round(209 - intensity * 100);
        return `rgb(${colorValue}, ${colorValue}, ${colorValue})`;
    };


    const renderResultView = (resultData) => {
        if (!resultData) return null;

        const { rawScores, tScores, globalScores, itemScores: resultItemScores } = resultData;

        const chartData = [
            ...Object.keys(scales).map(key => ({
                name: key,
                shortName: key.substring(0, 7) + '.',
                'T-Wert': tScores[key],
                'Rohwert': rawScores[key],
            })),
            { name: 'spacer', 'T-Wert': null, shortName: '' }, // Spacer
            { name: 'GSI', shortName: 'GSI', 'T-Wert': tScores.GSI, 'Rohwert': globalScores.gsi.toFixed(2) },
            { name: 'PST', shortName: 'PST', 'T-Wert': tScores.PST, 'Rohwert': globalScores.pst },
            { name: 'PSDI', shortName: 'PSDI', 'T-Wert': tScores.PSDI, 'Rohwert': globalScores.psdi.toFixed(2) },
        ];

        const significantScales = Object.entries(tScores)
            .filter(([key]) => scales[key] && tScores[key] >= 55)
            .sort(([, valA], [, valB]) => valB - valA);

        const CustomTooltipContent = ({ active, payload }) => {
            if (active && payload && payload.length) {
                const data = payload[0].payload;
                if (!data.name || data.name === 'spacer') return null;

                return (
                    <div className="bg-white p-4 border rounded-md shadow-lg max-w-xs text-left">
                        <p className="font-bold text-gray-800">{data.name}</p>
                        <p className="text-sm text-gray-600">
                            <span className="font-semibold">T-Wert:</span> {data['T-Wert']} | <span className="font-semibold">Rohwert:</span> {data['Rohwert']}
                        </p>
                        {scaleDetails[data.name] && <p className="mt-2 text-xs text-gray-500">{scaleDetails[data.name].inhalt}</p>}
                    </div>
                );
            }
            return null;
        };

        const GlobalScore = ({ label, value, tValue, interpretation }) => {
            const colorClass = tValue >= 60 ? 'bg-red-100 text-red-800' : tValue >= 55 ? 'bg-yellow-100 text-yellow-800' : 'bg-gray-100 text-gray-800';
            return (
                <div className={`p-3 rounded-md ${colorClass}`}>
                    <div className="flex justify-between items-center">
                        <span className="font-semibold">{label}</span>
                        <span className="font-bold text-lg">{value} (T={tValue})</span>
                    </div>
                    <p className="text-sm mt-1">{interpretation}</p>
                </div>
            );
        };


                return (
            <div className="bg-white p-6 rounded-2xl shadow-lg mt-8">
                <h2 className="text-2xl font-semibold mb-6 text-gray-800 border-b pb-3">Ergebnisse vom {new Date(resultData.date).toLocaleDateString('de-DE')}</h2>
                <div className="mb-8">
                    <h3 className="text-xl font-semibold mb-4 text-gray-700">T-Werte Profil</h3>
                     <ResponsiveContainer width="100%" height={400}>
                        <BarChart data={chartData} margin={{ top: 5, right: 20, left: 0, bottom: 60 }}>
                            <CartesianGrid strokeDasharray="3 3" />
                            <XAxis dataKey="shortName" angle={-60} textAnchor="end" interval={0} height={80} style={{ fontSize: '10px' }} />
                            <YAxis domain={[20, 90]} />
                            <Tooltip content={<CustomTooltipContent />} cursor={{fill: 'rgba(239, 246, 255, 0.5)'}}/>
                            <ReferenceLine y={60} label={{ value: 'Auffällig (T≥60)', position: 'insideTopLeft', fill: '#ef4444', fontSize: 12 }} stroke="red" strokeDasharray="3 3" />
                            <ReferenceLine y={55} label={{ value: 'Grenzwertig (T≥55)', position: 'insideTopLeft', fill: '#f59e0b', fontSize: 12 }} stroke="orange" strokeDasharray="3 3" />
                            <Bar dataKey="T-Wert">
                                {chartData.map((entry, index) => (
                                    <Cell key={`cell-${index}`} fill={getBarColor(entry['T-Wert'])} />
                                ))}
                            </Bar>
                        </BarChart>
                    </ResponsiveContainer>
                </div>
                 <div className="mt-8">
                    <h3 className="text-xl font-semibold mb-4 text-gray-700">Zusammenfassende Interpretation</h3>
                    <div className="space-y-4">
                        <div>
                            <h4 className="font-bold text-lg mb-2">Globale Kennwerte</h4>
                            <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
                                <GlobalScore label="GSI" value={globalScores.gsi.toFixed(2)} tValue={tScores.GSI} interpretation={scaleDetails.GSI.inhalt} />
                                <GlobalScore label="PST" value={globalScores.pst} tValue={tScores.PST} interpretation={scaleDetails.PST.inhalt} />
                                <GlobalScore label="PSDI" value={globalScores.psdi.toFixed(2)} tValue={tScores.PSDI} interpretation={scaleDetails.PSDI.inhalt} />
                            </div>
                        </div>

                        <div>
                            <h4 className="font-bold text-lg mb-2 mt-4">Auffällige Skalen (T-Wert ≥ 55)</h4>
                            {significantScales.length > 0 ? (
                                <ul className="space-y-2">
                                    {significantScales.map(([key, value]) => {
                                        const colorClass = value >= 60 ? 'bg-red-100' : 'bg-yellow-100';
                                        const scaleItems = scales[key];
                                        return (
                                            <li key={key} className={`p-3 rounded-md transition-all duration-300 ${colorClass}`}>
                                                <div className="flex justify-between items-center cursor-pointer" onClick={() => toggleExpand(key)}>
                                                    <span className="font-semibold">{key}</span>
                                                    <span className="font-bold">T = {value}</span>
                                                </div>
                                                <p className="text-sm text-gray-600 mt-1 italic">{scaleDetails[key].inhalt}</p>
                                                {expandedScales[key] && (
                                                    <div className="mt-2 pt-2 border-t border-gray-400 text-sm text-gray-700 space-y-3">
                                                        <div><span className="font-semibold">Typische Symptome:</span> {scaleDetails[key].symptome}</div>
                                                        <div><span className="font-semibold">Klinische Bedeutung:</span> {scaleDetails[key].bedeutung}</div>
                                                        <div className="mt-2">
                                                            <p className="font-semibold">Item-Antworten:</p>
                                                            <ul className="list-disc list-inside columns-2">
                                                                {scaleItems.map(itemNum => (
                                                                    <li key={itemNum}>Item {itemNum}: <span className="font-bold">{resultItemScores[itemNum - 1]}</span></li>
                                                                ))}
                                                            </ul>
                                                        </div>
                                                    </div>
                                                )}
                                            </li>
                                        );
                                    })}
                                </ul>
                            ) : (
                                <p className="text-sm text-gray-600">Keine klinisch auffälligen oder grenzwertigen Werte auf den Hauptskalen.</p>
                            )}
                        </div>
                        <div className="mt-6">
                             <h4 className="font-bold text-lg mb-2">Items nach Score filtern</h4>
                             <div className="flex space-x-2 mb-2">
                                {[1, 2, 3, 4].map(scoreValue => (
                                    <button key={scoreValue} onClick={() => setActiveScoreFilter(activeScoreFilter === scoreValue ? null : scoreValue)}
                                        className={`px-3 py-1 text-sm rounded-full ${activeScoreFilter === scoreValue ? 'bg-indigo-600 text-white' : 'bg-gray-200 text-gray-700'}`}>
                                        Score {scoreValue}
                                    </button>
                                ))}
                             </div>
                             {activeScoreFilter !== null && (
                                <div className="p-3 bg-gray-50 rounded-md">
                                    <ul className="list-disc list-inside columns-2 sm:columns-3 md:columns-4">
                                        {resultItemScores.map((score, index) => parseInt(score, 10) === activeScoreFilter && (
                                            <li key={index} className="text-sm">
                                                <strong>Item {index + 1}:</strong> {itemDetails[index + 1] || 'Unbekanntes Item'}
                                            </li>
                                        )).filter(Boolean)}
                                    </ul>
                                </div>
                             )}
                        </div>
                    </div>
                 </div>
            </div>
        );
    };

    return (
        <div>
            <h4 className="text-xl font-semibold text-gray-700 mb-4">SCL-90-R Erfassung & Auswertung</h4>

            <div className="bg-white p-6 rounded-2xl shadow-lg mb-8">
                <h2 className="text-2xl font-semibold mb-4 text-gray-800 border-b pb-2">Patienten- & Testdaten</h2>
                <div className="grid grid-cols-1 md:grid-cols-3 gap-6 mb-6">
                    <div>
                        <label htmlFor="scl-age" className="block text-sm font-medium text-gray-700 mb-1">Alter</label>
                        <input type="number" id="scl-age" value={age} onChange={(e) => setAge(e.target.value)} className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500 sm:text-sm h-10 px-3" placeholder="z.B. 35" />
                    </div>
                    <div>
                        <label htmlFor="scl-gender" className="block text-sm font-medium text-gray-700 mb-1">Geschlecht</label>
                        <select id="scl-gender" value={gender} onChange={(e) => setGender(e.target.value)} className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500 sm:text-sm h-10 px-2">
                            <option value="1">Männlich</option>
                            <option value="2">Weiblich</option>
                        </select>
                    </div>
                    <div>
                        <label htmlFor="scl-date" className="block text-sm font-medium text-gray-700 mb-1">Testdatum</label>
                        <input type="date" id="scl-date" value={newTestDate} onChange={(e) => setNewTestDate(e.target.value)} className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500 sm:text-sm h-10 px-3" />
                    </div>
                </div>

                <div className="grid grid-cols-5 md:grid-cols-10 gap-x-4 gap-y-2">
                    {itemScores.map((score, index) => (
                        <div key={index} className="flex flex-col">
                            <label htmlFor={`item-${index}`} className="mb-1 text-xs font-medium text-gray-600">Item {index + 1}</label>
                            <input 
                                ref={el => inputRefs.current[index] = el}
                                type="number" 
                                id={`item-${index}`} 
                                value={score} 
                                onChange={(e) => handleItemChange(index, e.target.value)} 
                                min="0" max="4" 
                                className="w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500 sm:text-sm h-10 px-2 text-center"/>
                        </div>
                    ))}
                </div>
            </div>

            <div className="flex flex-col sm:flex-row justify-center items-center gap-4 mb-8">
                <button onClick={calculateResults} className="w-full sm:w-auto bg-indigo-600 text-white font-semibold py-3 px-8 rounded-lg shadow-md hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500 transition-transform transform hover:scale-105 flex items-center justify-center">
                    <CalculateIcon /> Auswerten
                </button>
                <button onClick={resetForm} className="w-full sm:w-auto bg-gray-200 text-gray-700 font-semibold py-3 px-8 rounded-lg shadow-md hover:bg-gray-300 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-gray-400 transition-transform transform hover:scale-105 flex items-center justify-center">
                    <ResetIcon /> Zurücksetzen
                </button>
                {results && !viewingResult && (
                     <button onClick={handleSave} className="w-full sm:w-auto bg-green-600 text-white font-semibold py-3 px-8 rounded-lg shadow-md hover:bg-green-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-green-500 transition-transform transform hover:scale-105 flex items-center justify-center">
                        <SaveIcon /> Ergebnis Speichern
                    </button>
                )}
            </div>

            {error && <p className="bg-red-100 text-red-700 p-3 rounded-md mb-4 text-sm">{error}</p>}

            {viewingResult ? renderResultView(viewingResult) : renderResultView(results)}

            <div className="mt-8">
                <h3 className="text-xl font-semibold mb-4 text-gray-700">Protokollierte SCL-90-R Ergebnisse</h3>
                 {(patient.scl90rResults || []).length === 0 ? (
                    <p className="text-sm text-gray-500">Keine SCL-90-R Ergebnisse für diesen Patienten erfasst.</p>
                ) : (
                    <ul className="space-y-2">
                        {(patient.scl90rResults || []).map((result, index) => (
                            <li key={index} className="bg-white p-3 rounded-md shadow-sm border flex justify-between items-center cursor-pointer hover:bg-indigo-50" onClick={() => setViewingResult(result)}>
                                <div>
                                    <span className="font-medium text-indigo-600">Datum: {new Date(result.date).toLocaleDateString('de-DE')}</span>
                                    <span className="ml-4 text-sm text-gray-600">GSI: <span className="font-bold">{result.globalScores.gsi.toFixed(2)} (T={result.tScores.GSI})</span></span>
                                    <span className="ml-4 text-sm text-gray-600">PST: <span className="font-bold">{result.globalScores.pst} (T={result.tScores.PST})</span></span>
                                    <span className="ml-4 text-sm text-gray-600">PSDI: <span className="font-bold">{result.globalScores.psdi.toFixed(2)} (T={result.tScores.PSDI})</span></span>
                                </div>
                                <button onClick={(e) => { e.stopPropagation(); onDeleteResult(result.date); }} className="text-red-500 hover:text-red-700 transition duration-150 p-1 rounded hover:bg-red-100" title="Dieses Ergebnis löschen">
                                    <Trash2 className="w-5 h-5" />
                                </button>
                            </li>
                        ))}
                    </ul>
                )}
            </div>
        </div>
    );
};

export default SCL90RComponent;
